import React, { useState } from 'react';
import './App.css';

function App() {
  const [submitting, setSubmitting] = useState(false);
  const handleSubmit = event => {
    event.preventDefault();
   setSubmitting(true);

   setTimeout(() => {
     setSubmitting(false);
   }, 3000)
 }

  return(
    <div className="wrapper">
      <h1>Lorum Ipsem Lorum Ipsem Lorum Ipsem</h1>
      {submitting &&
       <div>Submtting Form...</div>
     }

      <form onSubmit={handleSubmit}>
        <fieldset>
          <label>

            <div class="myself">

            <div class="property">Investment Amount:</div>
            <div class="value"><input type="number" min="0.01"/></div>

            <div class="property">Investment Type:</div>
            <div class="value"><input type="text" name="type"/></div>

            <div class="property">Total Net Worth </div>
            <div class="value"><input type="number" min="0.01" /></div>

            <div class="property">User Estimated Yearly Income </div>
            <div class="value"><input type="number" min="0.01"/></div>

            <div class="property">User Estimated Credit Score </div>
            <div class="value"><input type="number" min="300" max="850" step="1"/></div>

            </div>

          </label>
        </fieldset>
        <button type="submit">Submit</button>
      </form>
    </div>
  )
}

export default App;
